import HeaderDashBoard from './HeaderDashBoard';
import './Meter2.css'
const DashboardMain = () => {
    return (
        <div className="row">
        <div className="col-md-3"></div>
            <div className="col-md-9 bodyBackground">
            <HeaderDashBoard/>
            </div>
        </div>
    );
};

export default DashboardMain;
